import React from 'react';
import TextField from '@material-ui/core/TextField';

const InputItem = () => (<p>
    <TextField
        id="filled-full-width"
        label="Label"
        style={{ margin: 8 }}
        placeholder="Placeholder"
        margin="normal"
        variant="filled"
        InputLabelProps={{
            shrink: true,
        }}
    />
</p>);

export default InputItem;
